import { featuredPortfolio } from '../../data.js';
import CardContainer from '../../components/cardContainer/CardContainer.jsx';
import './portfolio.scss';

function Portfolio( { openModal } ) {
  return (
    <div className="portfolio">
        <div className="container">
            <h1>Portfolio</h1>
            <h3>This portfolio was created using React</h3>
            <a href="https://github.com/yourusername/yourrepository" target="_blank" rel="noopener noreferrer">
                <button>View on GitHub</button>
            </a>
            <CardContainer items={featuredPortfolio} openModal={openModal} />
        </div>
    </div>
  );
}

export default Portfolio;
